var title_f14_42_15008="Pressures mitral stenosis I";
var content_f14_42_15008=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F52342&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F52342&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pressure tracings in mitral stenosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 417px; height: 182px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Pressures in a patient with mitral stenosis are recorded simultaneously from the left atrium (LA) and left ventricle (LV). There is a persistent pressure gradient throughout all of diastole (shaded area) as LA pressure is higher than that in the LV due to significant mitral stenosis. The pressure gradient is greatest during the initial part of diastole, is reduced during diastole as blood flows from LA into LV, and then increases at the end of diastole as a result of atrial contaction (A wave).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from Kern MJ (Ed). Hemodynamic Rounds: Interpretation of Cardiac Pathophysiology from Pressure Waveform Analysis. Wiley-Liss, New York, 1993.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
