" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Time course of natriuresis during recovery from minimal change disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 329px; height: 248px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Fractional excretion of sodium (FENa, percent), plasma creatinine concentration (PCr, mg/dL), plasma renin activity, and plasma albumin concentration (PAlb, g/dL) in patients with minimal change disease both before therapy and at the time of peak diuresis during corticosteroid-induced remission. The FENa rose, in association with reductions in the plasma creatinine concentration and plasma renin activity, and a minimal elevation in the plasma albumin concentration.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Koomans, HA, Boer, WH, Dorhout Mees, EJ, Nephron 1987; 47:173.",
"    </div>",
